components:
  schemas:
    tmp0:
      properties:
        asn: {type: string}
        confidence: {type: string}
        country: {type: string}
        created_ts: {type: string}
        description: {type: string}
        expiration_ts: {type: string}
        feed_id: {type: string}
        id: {type: string}
        import_session_id: {type: string}
        ip: {type: string}
        is_public: {type: string}
        itype: {type: string}
        latitude: {type: string}
        longitude: {type: string}
        meta_detail2: {type: string}
        meta_severity: {type: string}
        modified_ts: {type: string}
        org: {type: string}
        owner_organization_id: {type: string}
        rdns: {type: string}
        resource_uri: {type: string}
        retina_confidence: {type: string}
        source: {type: string}
        source_reported_confidence: {type: string}
        status: {type: string}
        threat_type: {type: string}
        threatscore: {type: string}
        type: {type: string}
        update_id: {type: string}
        uuid: {type: string}
        value: {type: string}
      type: object
  securitySchemes:
    BasicAuth: {scheme: basic, type: http}
info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of Anomali ThreatStream
  title: Anomali ThreatStream
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Anomali ThreatStream Lookup Indicator by source address
      parameters:
      - description: Target IOC to lookup
        example: 112.3.22.1 | https://maliciousurl.com
        in: query
        name: Indicator
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Anomali ThreatStream Indicator Lookup
servers: ['https://api.threatstream.com/api/v2']
tags:
- {name: Investigation}
